INSERT INTO `comics` VALUES (487, 93, '私密教学', 'https://www.syyym.net/yy/4611.html', 'https://img.ddmhjpg.top/kimi30/lifan/storage/cover/00a6bbe292e9979973a64c059e1f8004.jpg', '里番漫画', '完结', '私密教学13岁那年成为孤儿的子豪，被爸爸的朋友收养。然而成年后的子豪却对男女交往一无所知，阿姨与姐姐们决定给纯洁的子豪，来场教学……', '2025-11-18 03:10:04', '第261话 八方汇聚！', '2025-11-19 22:55:54', '2025-11-19 23:08:12', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (488, 94, '寄宿日记', 'https://www.syyym.net/yy/4193.html', 'https://img.ddmhjpg.top/kimi30/lifan/storage/cover/48eca4ffd276976592562b74063fb711.jpg', '里番漫画', '完结', '寄宿日记今年大一的俊宇因故寄宿在学校附近的朋友家中，某天深夜偶然看见朋友妈妈在房裡…「…是我眼花看错了吧?」', '2025-11-19 17:45:04', '第237话 让人疯狂的神晶', '2025-11-19 22:55:57', '2025-11-19 23:08:15', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (489, 93, '物种起源', 'https://www.syyym.net/yy/2119.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/957241502bbe014b3338ee68098e908a.jpg', '', '完结', '物种起源白手起家的年轻财阀alpha受某企业高管的秘密委托，欲在即将在上海召开的秘密竞拍中拍下一个武器。但是因某人从中作梗导致竞拍取消，甚至任务也有可能会失败。对于诽谤者的唯一线索只有一个，就是在现场抓到的佣兵团自称是在神秘人物‘老师’的指示下参与了这个任务的黑客李永振，面对想要处置自己的胜贤，提出了一个交易。用武器的线索换取同伴们的安全，并做为担保拍摄‘xx录像’。虽然有些愚蠢但却莫名有些性感的年轻omega的荒唐提议，让胜贤开始一点一点对永振产生了兴趣...', '2025-11-16 05:35:04', '第246话师徒二人不得不说的故事', '2025-11-19 22:55:59', '2025-11-19 23:08:17', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (490, 95, '寄宿', 'https://www.syyym.net/yy/3061.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/4a53099b4db550b28a29b086d61837f2.jpg', '寄宿', '连载', '寄宿今年大一的俊宇与爸妈怄气，因此寄宿在学校附近的朋友家中。朋友家里还有一个单身母亲和两个女儿...因为一次意外，一种别样的气氛在家里荡漾开来。...', '2025-11-16 06:40:04', '第295话文化的力量', '2025-11-19 22:56:03', '2025-11-19 23:08:20', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (491, 93, '健身教练', 'https://www.syyym.net/yy/4632.html', 'https://img.ddmhjpg.top/kimi30/lifan/storage/cover/24f5c86c75271c70a879fc1dc47065dd.jpg', '里番漫画', '连载', '健身教练贤秀是业绩万年垫底的健身教练，而组长杰森凭着销售能力和亲密的肢体接触常年独占业绩第一名的宝座。当青梅竹马来到健身房运动时，贤秀要怎么阻止她遭受到杰森的毒手呢？', '2025-11-01 09:30:05', '第265话 海州老大张万军', '2025-11-19 22:56:04', '2025-11-19 23:08:22', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (492, 93, '健身馆教练', 'https://www.syyym.net/yy/1912.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/445fc341abe246c6bc2a5b93dd523700.jpg', 'WM', '连载', '健身馆教练贤修是业绩万年垫底的健身教练，而经理则是常年占据业绩第一名，当青梅竹马来到健身房运动时，贤修要怎么阻止她遭受经理的毒手呢？', '2025-10-31 06:10:05', '第223章：结婚【完结】日月二君难撼神', '2025-11-19 22:56:07', '2025-11-19 23:08:25', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (493, 93, '巨人族的新娘', 'https://www.syyym.net/yy/2526.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/4a70b7fc20129cd3f1e7332fd32c595b.jpg', '耽美', '完结', '巨人族的新娘那种东西进来的话…一定会死的！某一天忽然被召唤到其他世界的古一那里生活的人们…都是非常大的巨人！被选为巨人王国王子凯乌斯新娘的古一要接受他的非一般情况（？）的那里才行…！？', '2025-11-18 05:25:04', '第176话我不想长大', '2025-11-19 22:56:10', '2025-11-19 23:08:27', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (494, 95, '女儿闺蜜都归ME', 'https://www.syyym.net/yy/3042.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/30868eb0f1100ff18d9963dea6b0a6b5.jpg', '女儿闺蜜都归ME', '连载', '女儿闺蜜都归ME年轻时曾是偶像歌手，现在是制作人的世勋，偶然看到女儿的社群软体，被一位长得跟自己理想型相似的少女吸引目光......', '2025-11-18 05:10:01', '第228话打劫二人组', '2025-11-19 22:56:12', '2025-11-19 23:08:29', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (495, 93, '重考生', 'https://www.syyym.net/yy/4600.html', 'https://img.ddmhjpg.top/kimi30/lifan/storage/cover/9d255e44257d6add08089ccdb88363bf.jpg', '里番漫画', '连载', '重考生收到备取通知的当天，备取5的正妹主动联络我，说只要我把递补名额让给她，她就愿意当我P友…?', '2025-11-14 15:05:05', '第273话 玄天冥，你有眼光', '2025-11-19 22:56:14', '2025-11-19 23:08:32', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (496, 93, '魔咒', 'https://www.syyym.net/yy/11004.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/3744b997cb889ae3dd6f8660d5e071fe.jpg', '', '完结', '魔咒综合格斗轻重量级冠军,‘周在京’虽然被写作无败神话,但其实有一个他人都不知道的魔咒.那就是在比赛前一天必须要有一次满意的sex才能获得胜利!在京想要通过物理治疗师‘金谈’解决了这个魔咒…', '2025-11-15 15:10:05', '第135话毛利，扶我起来', '2025-11-19 22:56:16', '2025-11-19 23:08:36', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (497, 95, '帐篷里的秘密', 'https://www.syyym.net/yy/5342.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/3e7ae4bd7f44bf45412fee9ed3e5181a.jpg', '帐篷里的秘密', '连载', '帐篷里的秘密刚新婚六个月的家铭与妻子正是享受两人世界的甜蜜时期，却因妻子工作繁忙只能独守空闺。家铭为了改善夫妻关係带着妻子与大学三五好友一起去露营。而就在露营第一晚发生了走...', '2025-11-15 16:50:04', '第184话让他们俯首称臣！', '2025-11-19 22:56:19', '2025-11-19 23:08:38', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (498, 96, '魔王逆谋', 'https://www.syyym.net/yy/5822.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/d417268dca72f1658126b17e8f91e8e3.jpg', 'Darurung', '连载', '魔王逆谋失去力量的魔王利文，受到手下四名下属的谋逆，在接受自己死亡的时刻，谋逆的主谋却露出了意味深长的笑容，“你要为我们诞下新的王才可以哦。”', '2025-11-18 11:10:04', '第125章：【第二季】无敌之功隔空灌顶借元神', '2025-11-19 22:56:21', '2025-11-19 23:08:41', 1, 0, 0, 0, 0, 0);
