INSERT INTO `comics` VALUES (506, 93, '比邻而交', 'https://www.syyym.net/yy/2005.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/fca5c8655a74a0fdeccd990022f33186.jpg', 'QZ&JWQ', '连载', '比邻而交志豪与慧美从小一起长大，多熙则是慧美大学时期的闺蜜，三人的感情在志豪大二后开始有了巨大的变化...', '2025-11-16 05:50:04', '第280章：冥币【万更求订阅】彪的像个二虎子！', '2025-11-19 22:56:43', '2025-11-19 23:09:03', 1, 0, 0, 0, 0, 0);
