INSERT INTO `comics` VALUES (508, 93, '海之边境', 'https://www.syyym.net/yy/4095.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/8d6f458963457fb99854dc716f10542a.jpg', 'aiyou', '连载', '海之边境天降横祸，一无所有背上巨债的金义贤，决心带着年幼的弟弟一起入海自杀，却被追债人所救，伸向自己的手，会带他去往天堂还是地狱?小编觉得很赞哦~力推goodgood！', '2025-11-15 22:15:04', '第162章：【第二季】他们都能说话不怕撞着吗？', '2025-11-19 22:56:50', '2025-11-19 23:09:09', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (509, 93, '疯狂列车', 'https://www.syyym.net/yy/5334.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/8268c8beea8bec66d8c0a266b0716138.jpg', '', '完结', '疯狂列车带着任务上列车的苏维安,喝着杰尔金送来的水,身体发热。杰尔金在苏维安的后面发现了藏物的珠子,就在苏维安晕倒时,珠子也一起消失了。苏维安为了寻找珠子走向了杰尔金的贵宾车厢...热腾腾的身体，不停歇的火车，还有接近苏维安的男人，这一切都很奇怪。苏维安能见到杰尔金并找回珠子吗？', '2025-11-18 03:55:04', '第181话许家姐妹的危机', '2025-11-19 22:56:52', '2025-11-19 23:09:11', 1, 0, 0, 0, 0, 0);
