INSERT INTO `comics` VALUES (535, 99, '荧幕经纪人', 'https://www.syyym.net/yy/14994.html', 'covers/3ee4243e7a86ff9f0929daccfb9439a4.jpg', 'UIBN', '完结', '荧幕经纪人妻鸟明为了帮助发小足立藤的梦想，成为了他的经纪人，一起在美国发展事业。直到最近，两人重新回到日本休假，并开始了同居生活...', '2025-11-19 22:40:05', '第101章：最棒的夜晚（完结） 打鸡血了！', '2025-11-19 22:58:43', '2025-11-19 22:58:43', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (536, 93, '不枉此生女王篇', 'https://www.syyym.net/yy/9136.html', 'covers/6ab9666a5667f6a976254a1b7df65a79.jpg', 'FG', '完结', '不枉此生女王篇浪子朴道谦准备相亲，但因为只是想跟人家滚床单的缘故相亲一直没有后续而身为她的欧米伽秘书李盛雅暗恋着她总是默默给她解决麻烦，直到一次酒会上李盛雅被别的阿尔法拐走后朴道谦才意识到他在自己心里的地位...', '2025-11-19 22:40:05', '第116章白马探：一步登天……境！', '2025-11-19 22:58:49', '2025-11-19 22:58:49', 0, 0, 0, 0, 1, 0);
