INSERT INTO `comics` VALUES (538, 97, '大师学徒', 'https://www.syyym.net/yy/6137.html', 'covers/c1750ccc43272ba5423049875b0ccf80.jpg', '里番漫画', '连载', '大师学徒为了成为职业画家，泰盛拜入著名画家李惠道门下成为了一名学徒，本想着努力为梦想奋斗，谁曾想见到师母的第一面起，泰盛的人生走上了不一样的道路……！', '2025-11-19 22:40:05', '第82话 天魔古符！战神印！', '2025-11-19 22:58:58', '2025-11-19 22:58:58', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (539, 99, '都市协奏曲', 'https://www.syyym.net/yy/12674.html', 'covers/21d5e1263f10300d9a894e78683032d2.jpg', 'OInas', '连载', '都市协奏曲这个世界上，圆满的恋情都是一样的，而不幸的恋人，却各有各的不幸。其实不论过程再困难，我们始终会收获各自的幸福……！', '2025-11-19 22:40:04', '第120章：固话有光自镜都来', '2025-11-19 22:59:06', '2025-11-19 22:59:06', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (540, 93, '苦甜宝贝', 'https://www.syyym.net/yy/9886.html', 'covers/6f1173c24235d37c4507c09f0b34bdf7.jpg', 'MIAENA', '连载', '苦甜宝贝郑时雨被冤枉对演员下药，韩泰林得知此事马上解雇了他，之后郑时雨因为缺钱在朋友的推荐下进入一家艺人接触金主的酒吧工作，恰巧被韩泰林碰到又被误会，之后韩泰林意识到自己的错后邀请郑时雨住进自己家...', '2025-11-19 22:40:04', '第122章：洛若曦的身份【第三更】月月的童话为证道，做准备', '2025-11-19 22:59:10', '2025-11-19 22:59:10', 0, 0, 0, 0, 1, 0);
