INSERT INTO `comics` VALUES (542, 95, '情癫老爸', 'https://www.syyym.net/yy/3389.html', 'covers/b2a9bd962657f348018516e97cbc2114.jpg', '情癫老爸', '完结', '情癫老爸爹您私生活也太不检点了吧，去世后留给我一摊子后宫。不过真的谢谢你嘞！...', '2025-11-19 22:40:04', '第111话福冈城升级', '2025-11-19 22:59:19', '2025-11-19 22:59:19', 0, 0, 0, 0, 1, 0);
