INSERT INTO `comics` VALUES (544, 93, '成长的契机', 'https://www.syyym.net/yy/4001.html', 'covers/9f9d1f6368019a8f195d17a300e77cb8.jpg', 'Godo Name', '完结', '成长的契机在乡下有一个特别的风俗，跳进溪水里就会被认为是大人。渴望长大的库拓便是在溪水边与日高相识了...', '2025-11-19 22:40:02', '第97章：吴道镜【第一更】天道有轮回', '2025-11-19 22:59:29', '2025-11-19 22:59:29', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (545, 93, '别去按摩店', 'https://www.syyym.net/yy/15053.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/e4cfceacec813ce1ad35536be7f7d4f8.jpg', '', '连载', '别去按摩店作为救了部下一命的回报，头目姜哲得到了一张按摩店优惠券。为了缓解因长时间的战斗而紧张的身体，姜哲去了按摩店。让我换的衣服有点暴露啊…真的是让我穿这个吗？！', '2025-11-16 14:40:05', '第99话一个牢头的幸福生活', '2025-11-19 22:59:31', '2025-11-19 23:10:46', 0, 0, 1, 1, 0, 593055);
INSERT INTO `comics` VALUES (546, 104, '大公的秘密契约', 'https://www.syyym.net/yy/15052.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/b51e002f4faa24cd8f0b0f1b9224cfce.jpg', '', '完结', '大公的秘密契约被诅咒的北部大公每晚都被欲火折磨。偶然看到这个情景的魔法师提出愿意和大公签订秘密契约，那就是他帮大公排解，大公则为他提供研究材料…', '2025-11-14 07:40:04', '第98话故人，冷一刀', '2025-11-19 22:59:33', '2025-11-19 23:10:49', 0, 0, 1, 1, 0, 118072);
INSERT INTO `comics` VALUES (547, 105, '失重的爱情', 'https://www.syyym.net/yy/15051.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/5dc819daa1c912f60de77e714f5add1a.jpg', '', '完结', '失重的爱情为了还清父亲欠下的债款朴素翰一个人到处打工赚钱,过了6年终于还清所有欠款打算在新家开始新的生活.但是只开心了一会儿,一艘宇宙飞船就砸坏了他的房子.就在素翰喊着管他是不是外星人给我从家里滚出去的时候,他见到了从飞船下来的诗华...“你哭的样子,真的很难看.我会把你变得好看的,你继续哭吧没事的地球人?”房子被弄坏已经很伤心了,现在还要被外星人戏弄吗?', '2025-11-18 05:35:05', '第98话欺山莫欺水', '2025-11-19 22:59:36', '2025-11-19 23:10:51', 0, 0, 1, 1, 0, 55874);
INSERT INTO `comics` VALUES (548, 106, '哈尼熊', 'https://www.syyym.net/yy/15050.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/10a12bd69fcef67afbb1b62e71b29b7a.jpg', '', '完结', '哈尼熊文健宇，年龄21岁。拥有高大的身材和挺拔的身躯以及致命的凶器（？），却完全没有任何经验。唯一感兴趣的事就只有运动！有一天，带着黄油香的面包店老板刘河振出现在了健宇面前！单纯青年健宇被河振的香甜所倾倒，于是...！！', '2025-11-19 10:30:04', '第107话冲关准君王！', '2025-11-19 22:59:39', '2025-11-19 23:10:59', 0, 0, 1, 1, 0, 41323);
INSERT INTO `comics` VALUES (549, 95, '不良关系', 'https://www.syyym.net/yy/15049.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/e18262f054f9190d73deb7df3c97160f.jpg', '不良关系', '连载', '不良关系陈晟真在下宿居住时，遇见了他命中的女神-善美姐，两人渐渐发展成了秘密交往的关系。但是当善美外出留学归来，却突然宣布自己已经结婚，而更让陈晟真没想到的是，善美的老...', '2025-11-19 00:55:04', '第87话麻将传到仙界', '2025-11-19 22:59:42', '2025-11-19 23:11:01', 0, 0, 1, 1, 0, 152404);
INSERT INTO `comics` VALUES (550, 95, '大学俱乐部', 'https://www.syyym.net/yy/15048.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/966dca2f0ccaf35afb6b41e4e9038f4b.jpg', '大学俱乐部', '连载', '大学俱乐部宋建宇因为开学时生病，错过了和同学们亲近的机会，导致被孤立。就在他彷徨时，收到了热情的英语会话社团的邀请，成为了她们中的一员......', '2025-11-07 08:20:04', '第95话碑与剑的过往', '2025-11-19 22:59:44', '2025-11-19 23:11:06', 0, 0, 1, 1, 0, 42188);
INSERT INTO `comics` VALUES (551, 94, '沐浴阳光', 'https://www.syyym.net/yy/15047.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/b401e3507ed380e24fe184bf18c3f032.jpg', '', '完结', '沐浴阳光这是发生在一位17年撩人却不自知和一位独自暗恋友人7年的两人之间的故事.文书允逃跑了.放弃的钢琴,母亲的死亡,父亲的外遇.还有爱恋了7年的友人有了女友.“书允啊,我足足等了你两年,你就一点都不想我吗?”书允冒着随时都会被发现的危险以’朋友’的名义呆在了延载的身边.看着突然抱上来的他,书允想起了那天见到的他的女友,他还是默默整理好了自己的心意.但是突然有一天,书允还是被延载发现他喜欢的是男生.书允为了隐瞒自己的心意对延载说谎了.“允延载.我...不喜欢男生.', '2025-11-18 04:45:04', '第96话毕玄，来给大爷乐一个！', '2025-11-19 22:59:47', '2025-11-19 23:11:15', 0, 0, 1, 1, 0, 45025);
INSERT INTO `comics` VALUES (552, 107, '火花夢', 'https://www.syyym.net/yy/15046.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/638c00038093c326bb92323f29e47303.jpg', '', '完结', '火花夢第七世，才是血淋淋的复仇！帮助了陷入困境的巫女的柳熙谦，获得了五次生命。五次生命都无疾而终后，柳熙谦再度复活。又一次地重生之后，内心目标只剩下了对叛徒的报复。因为某种变数，第七世中的生活出现了与记忆不同的画面。“结婚了，不管是死是活，贵妃现在都已经是我的人了。”怎么就成了英王唯一的贵妃，开始受到宠爱了呢…“如果你敢逃跑，我就会把你的腿割下来放在内院。”这是莫名执着的英王陈赫伟，和第七世还执着于复仇的柳熙谦的故事。', '2025-11-16 10:00:04', '第107话金袍执事袁雷', '2025-11-19 22:59:49', '2025-11-19 23:11:18', 0, 0, 1, 1, 0, 33025);
INSERT INTO `comics` VALUES (553, 108, '我们的转世', 'https://www.syyym.net/yy/15045.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/dad93ef69f71e3c937929bb59ec1db6d.jpg', '', '完结', '我们的转世本来幸福的生活因为一场谋反瞬间灰飞烟灭.“如果再给我一次机会的话…”在离死之前的祈祷之后,时间来到了2023年.失去了一切只剩下一条命还有什么意义.但是今生依旧和过去有着密切联系.有过生死之交的挚友,厌恶至极的元凶…还有过去的爱人都在这个世界相聚了.只是…转世之后还是前世的性别吗?', '2025-11-16 19:40:05', '第91话疯狂的女人', '2025-11-19 22:59:52', '2025-11-19 23:11:21', 0, 0, 1, 1, 0, 24152);
INSERT INTO `comics` VALUES (554, 93, '双头绳索', 'https://www.syyym.net/yy/15044.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/5e7ebef17cc3623f9cc3c79f2dabfdea.jpg', '', '完结', '双头绳索机构内的最精锐的超能力者“瑞克”遇到了指导者“贝利”，但因为贝利的特别之处，瑞克非但没有想着靠近贝利，反而想方设法地避开他。两人真的能在一起吗？', '2025-11-15 15:50:02', '第89话算利息给你们', '2025-11-19 22:59:55', '2025-11-19 23:11:23', 0, 0, 1, 1, 0, 15448);
INSERT INTO `comics` VALUES (555, 95, '我的女主人', 'https://www.syyym.net/yy/15043.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/51036b50b8301238ae196993e2ebd17d.jpg', '我的女主人', '连载', '我的女主人俊培为了完成开跑车的梦想，跑到大老板手下当随行司机。在经历一场大风波之后，俊培意外地和老板的女儿发生了关系。此后，俊培甚至搬进了老板的豪宅内，开始伺候起行事神秘...', '2025-11-17 15:35:01', '第95话我的剑，你接得住？', '2025-11-19 22:59:57', '2025-11-19 23:11:25', 0, 0, 1, 1, 0, 39650);
INSERT INTO `comics` VALUES (556, 93, '大佬的社内恋爱', 'https://www.syyym.net/yy/15042.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/926c4ffc002800050c383458ce71aea2.jpg', '', '完结', '大佬的社内恋爱‘社内恋爱一旦被发现，即刻处死’因吉童派传闻中禁止社内恋爱的条款，表面上是对手的左膀黄龙浩和右臂具子延过着白天杀气冲天，晚上情意绵绵的日子。就这样谈了4年恋爱后的某一天，两个人收到了一张匿名纸条？！“我知道你们在交往。可是组织里又不是只有你们两个人！！”', '2025-11-19 21:15:04', '第105话四个‘太阳’！', '2025-11-19 23:00:00', '2025-11-19 23:11:27', 0, 0, 1, 1, 0, 16793);
INSERT INTO `comics` VALUES (557, 94, '给哀悼的你', 'https://www.syyym.net/yy/15041.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/3d28dcb074c0ce36022168c688d8983d.jpg', '', '完结', '给哀悼的你我’金道允’为了救一个小孩被车撞死了.然后再次醒来发现自己变成了大学后辈’芮道允’.一直过着平凡生活的金道允虽然想努力适应大公司会长私生子芮道允的生活但两个人之间的差异还是太大了.唯一的共通点只有同校同系的后辈’韩洁’.道允下定决心去接近韩洁却发现他跟记忆中那个温柔的人完全不一样.“我不管你是想从我这里拿到什么,还是只是想耍我我都不在乎…但你别想着用这种东西来利用道允哥.不然的话我会杀了你的.”', '2025-11-17 10:15:04', '第97话南京，再见！', '2025-11-19 23:00:02', '2025-11-19 23:11:30', 0, 0, 1, 1, 0, 18315);
INSERT INTO `comics` VALUES (586, 94, '忘年之成绩交易', 'https://www.syyym.net/yy/14896.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/175254871ed27367cb45eb766d74ddda.jpg', '', '连载', '忘年之成绩交易不小心招惹了有恋人的人逃到军队退伍后又复学的‘许在赫’这个学期决定要好好学习的但是江山易改本性难移,最终还是差一点就面对了退学的危机.但是在赫想起了学校里教授的传闻于是找到了教授提出了一个交易…!', '2025-11-19 23:00:05', '第89话黑铁宝箱和黑铁钥匙', '2025-11-19 23:09:27', '2025-11-19 23:09:27', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (587, 109, '我以为我要死了', 'https://www.syyym.net/yy/14670.html', 'https://img.ddmhjpg.top//kimi30/coolomh/storage/cover/b897ee8055eac35236908ed8ace8a43d.jpg', '酷爱', '连载', '我以为我要死了得到医院诊断只能活3个月的布兰谢公爵家的公主，拉利埃特。反正是要死的人，决定完成遗愿清单。第一，捉弄她不喜欢，年纪又大的未婚夫。第二，和怪物公爵阿斯拉寒恋爱三个月！但是从他身边逃走后才明白。晚期诊断是完美的误诊！', '2025-11-19 23:00:05', '第101话吞噬，争分夺秒', '2025-11-19 23:09:29', '2025-11-19 23:09:29', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (588, 97, '镜头语言', 'https://www.syyym.net/yy/12689.html', 'https://img.ddmhjpg.top//fmgxinwys/storage/cover/72ed7618dfea931283d60f4f27268a7.jpg', 'Emsis', '完结', '镜头语言为了出人头地，一群男男女女加入了一场特殊的综艺活动，在这里发生的一切都会被如实的记录下来。', '2025-11-19 23:00:05', '第141章：真香【完结】柯南：我也不想的啊', '2025-11-19 23:09:31', '2025-11-19 23:09:31', 0, 0, 0, 0, 1, 0);
