INSERT INTO `comics` VALUES (590, 93, '体感游戏', 'https://www.syyym.net/yy/5788.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/e02f5d4cea294eb02f6db2b49b28c46b.jpg', 'onemai', '连载', '体感游戏李昌洙受到朋友的邀请来到一个奇怪的体验场游玩，期间发生了许多怪异的事情，就当他开始觉得不妙时，对方突然告白了...', '2025-11-19 23:00:05', '第103章：不想死听话有进无出！', '2025-11-19 23:09:37', '2025-11-19 23:09:37', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (591, 103, '月震', 'https://www.syyym.net/yy/4947.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/08c85b1f23bbfe0de7aaeaa23a568186.jpg', '', '完结', '月震月亮坠落在城市中央后，发生了超能力的现象…随之而出现的是居住在月球上，随心所欲地行使能力的“月亮出身的抵抗军居民”，和警惕他们的“现象者们”。某一天，展开战斗的“震雄”因为无法控制地震能力而重新灾害化的时候，被抵抗军首领“在河”找到了。反复相遇，感受到他人性的吸引，开始怀疑城市奇怪的面貌，而越来越偏向在河的震雄，在潜入施救的过程中被发现他已经被打上了抵抗军的烙印...', '2025-11-19 23:00:05', '第138话万军之中斩敌首级', '2025-11-19 23:09:40', '2025-11-19 23:09:40', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (592, 93, '破爱', 'https://www.syyym.net/yy/2829.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/36ef5faf25f0d92f2af17f647412906c.jpg', '耽美', '完结', '破爱秀仁的一对夫妻朋友因遭遇交通事故而不幸去世，秀仁便将其遗孤收为养子。相依为命的两人，发展出了一种比血缘更浓厚的感情…这段不受世人认可的关系，最终会走向破灭吗？', '2025-11-19 23:00:05', '第107话四公子再聚', '2025-11-19 23:09:43', '2025-11-19 23:09:43', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (593, 97, '白色的野兽', 'https://www.syyym.net/yy/1311.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/f26f983fc7ec14558f246b481f63551c.jpg', 'inena,m', '连载', '白色的野兽莱恩某次狩猎时掉进洞里，特殊动物仔空送给他一些野果和药救了他，两人素未谋面，之后仔空被莱恩抓回村里也不知道这是救命恩人，在相处中莱恩被仔空的善良可爱打动喜欢上对方。', '2025-11-19 23:00:05', '第115章：喜欢【完结】冲击，离开', '2025-11-19 23:09:47', '2025-11-19 23:09:47', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (594, 102, '从属', 'https://www.syyym.net/yy/11764.html', 'https://img.ddmhjpg.top//fmgxinwys/storage/cover/7cd56978c97e259532c8d4bc6d1c3c9c.jpg', 'ST', '连载', '从属作为装修经理的曲子玉负责前往酒吧了解方案，怎料在vip室遇到了一位容貌出众的客人，两人之间擦出了爱的火花，但曲子玉逐渐发现他似乎有些特殊癖好…', '2025-11-19 23:00:04', '第239章：找蓝电霸王龙家族增援【第一更！】另有乾坤隐浑天', '2025-11-19 23:09:49', '2025-11-19 23:09:49', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (595, 110, '扑通扑通攻略记', 'https://www.syyym.net/yy/9532.html', 'https://img.ddmhjpg.top//miandan/storage/cover/1637906144120.jpg', '扑通扑通攻略记', '连载', '扑通扑通攻略记一觉睡醒穿成了乙女游戏女主角！我竟发现在场所有人都可攻略！既然如此，目标打造一个全员都能幸福的后宫结局！可在这背后，又有谁能知道偷偷观察我的金发美男默默的涨了好感——啊啊~事情往不可控的方向发展了？！', '2025-11-19 23:00:02', '第187话一切的缘由', '2025-11-19 23:09:52', '2025-11-19 23:09:52', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (596, 111, '帝国的轮回', 'https://www.syyym.net/yy/10287.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/99a6a3a8753071a09e6a01ff8ba7e50c.jpg', '', '完结', '帝国的轮回斯特拉斯的皇太子列夫诺阿德决定和敌国艾尔帕歇尔的吉斯卡尔签订休战协议.却在回国的路上遭遇了毒杀,转世后变成了敌国艾尔帕歇尔农村里的一个奴隶.虽然依然带着前生的记忆和经验,但雷伊对自己现在奴隶的生活也算满意.但是某一天,雷伊却被当作床奴献给了自己一直当作毛头小子的艾尔吉斯卡尔帕歇尔…‘你是说要我在那个家伙的身下.那个实力还不如我的毛头小子!’会令自己颤抖的侮辱感和耻辱感也只是暂时的,雷伊并不符合奴隶身份的言行令所有人都大吃一惊.而一直在留心观察雷伊的吉斯卡尔发现了异端并', '2025-11-19 22:55:05', '第130话看我不爽，却拿我没办法！', '2025-11-19 23:09:54', '2025-11-19 23:09:54', 0, 0, 0, 0, 1, 0);
