INSERT INTO `comics` VALUES (601, 96, '传奇之旅', 'https://www.syyym.net/yy/8894.html', 'https://img.ddmhjpg.top/kimi30/fmgxin/storage/cover/111e59b4f5074bd7b341c831f96e636d.jpg', 'EINDX', '完结', '传奇之旅埃利尔斯.棉菲尔德因为厨艺非常好被第17任贤者菲尔维塞尔看中要带去一起越过国境前往齐勒帝国探险，与剑术精湛的保镖切斯特、不会魔法的魔道士阿德里安一行四人开始了探险之旅...', '2025-11-19 22:55:04', '第140章屠道！【第一更！求月票！】手握日月星辰！', '2025-11-19 23:10:08', '2025-11-19 23:10:08', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (602, 97, '梦游精灵', 'https://www.syyym.net/yy/7807.html', 'https://img.ddmhjpg.top/kimi30/fmgxin/storage/cover/368e3bac55a749959d8c924a39f4dbd0.jpg', 'Y', '连载', '梦游精灵16年前，纳因因为自身强大的欲望，反噬了来到自己梦中的精灵，从而被精灵王变成了一个半梦魔，开始掠夺别人的梦……', '2025-11-19 22:55:04', '第94章令人震惊的睡姿！【第二更！】拿作品说话星陨女王之路', '2025-11-19 23:10:12', '2025-11-19 23:10:12', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (603, 93, '被偏见的人', 'https://www.syyym.net/yy/7074.html', 'https://img.ddmhjpg.top/kimi30/fmgxin/storage/cover/f480f745fe6e4f9493aa20dfa65baa3d.jpg', 'GSZ', '完结', '被偏见的人地方大学毕业的我，却意外的进入了国家最大的公司就职。因为走后门，公司同事对我冷眼相看，不断的非议陷害接踵而来。最后还要凭着莫须有的罪名劝退我。此刻我意识到，要生存只有成为比所有人更坏的坏人！', '2025-11-19 22:55:04', '第311章服部平次：老剑出山【四更】九头蛇队长的位置还空着', '2025-11-19 23:10:15', '2025-11-19 23:10:15', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (604, 94, '叛逆成瘾（I+II季）', 'https://www.syyym.net/yy/2854.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/8c0e425675f0fc4d54e14fc42c2f879e.jpg', 'CW', '完结', '叛逆成瘾（I+II季）孤僻的车志宇，本想安安静静读完高三就结束这麻烦的学业，却不想遇到了温柔的班长弟弟，也是这个班里唯一愿意对他报以善意的人。无情地拒绝往来后，却因为困难，不得不向那个人求助。看着那个人毫无芥蒂的热心与温暖，他开始动摇了。偏偏这个时候，某个偏执霸道的男人回来到他的生活……', '2025-11-19 22:55:04', '第181话跑路的姿势都贱', '2025-11-19 23:10:17', '2025-11-19 23:10:17', 0, 0, 0, 0, 1, 0);
